We took the McLaren 720S and terrorized the streets of Toronto. Catching eyes and hearts of everyone, this rare spaceship is one of the best McLarens ever built. The 720S has the performance of a Formula 1 race car and the body of a UFO. With Dihedral doors, 710 HP, and a twin turbo - the sky is your limit. 

